import React from "react";
import logo from "../img/entur_logo.jpg";
import user from "../img/user.png";

class NavBar extends React.Component {

    state = {
        user: '',
    }



    render() {
        return (
            <nav className="navBar">
                <div className="padding">
                    <a href="/"><img src={logo} width={180} height={80} alt="Entur" /></a>
                    <div id="login">
                        <img id="user" src={user} width={50} height={50} alt="Login" />
                        <p className="text-center text-white">{
                            (localStorage.getItem("netexAuthorityId"))? localStorage.getItem("netexAuthorityId").split(":")[0]: 'loading'}</p>
                    </div>
                </div>
            </nav>
        )
    }
}

export default NavBar;
